import React from 'react';
import Banner from './components/Banner';
import Exhibit from './components/Exhibit';
import IPFetcher from './components/IPFetcher';

const App = () => {
  return (
    <div className="app">
      <Banner />
      <Exhibit>
        <IPFetcher ipAddressType="IPv4" />
      </Exhibit>
      <Exhibit>
        <IPFetcher ipAddressType="IPv6" />
      </Exhibit>
    </div>
  );
};

export default App;
